import React, { Component } from "module";
import './loader.css';
const LoaderHOC= (WrappedComponent) =>{
    return class LoaderHOCClass extends Component{
        render(){
            return this.props.constact.length === 0 ? <div className="loader"></div> : <WrappedComponent {...this.props}/>
        }
    }
}
export default LoaderHOCClass;
